// =============================================================================
// üíª Code Showcase Component - QElements Version
// =============================================================================
// This component demonstrates QElements with code examples and explanations.
// It shows how the QElements system works with parent-child styling.
// =============================================================================

import React, { useState } from 'react';
import { QElementComponent } from '../qelements/QElementComponent';

const CodeShowcase = () => {
  const [activeSection, setActiveSection] = useState('overview');

  const codeSections = {
    overview: {
      title: 'Music Platform Overview',
      description: 'How the music platform interface is built with React components',
      code: `// Main App Structure
import React, { useState } from 'react';

const MusicPlatform = () => {
  const [activeTab, setActiveTab] = useState('discover');
  const [selectedArtist, setSelectedArtist] = useState(null);

  return (
    <div style={{
      background: 'linear-gradient(135deg, #1a1a1a, #2d1b1b)',
      minHeight: '100vh',
      color: '#ffffff'
    }}>
      {/* Navigation and content */}
    </div>
  );
};`
    },
    components: {
      title: 'Component Structure',
      description: 'Building reusable components for the music interface',
      code: `// Artist Card Component
const ArtistCard = ({ artist, onClick }) => (
  <div
    onClick={() => onClick(artist)}
    style={{
      background: 'rgba(255,255,255,0.05)',
      borderRadius: '16px',
      padding: '1.5rem',
      cursor: 'pointer',
      transition: 'all 0.3s ease'
    }}
  >
    <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
      <div style={{ fontSize: '2.5rem' }}>
        {artist.image}
      </div>
      <div>
        <h4>{artist.name}</h4>
        <p>{artist.genre} ‚Ä¢ {artist.followers}</p>
      </div>
    </div>
  </div>
);`
    },
    styling: {
      title: 'Styling Approach',
      description: 'Using inline styles for dynamic theming and responsive design',
      code: `// Dynamic Styling with State
const buttonStyle = {
  background: activeTab === 'music' 
    ? 'linear-gradient(135deg, #dc2626, #ff6b6b)' 
    : 'rgba(255,255,255,0.05)',
  color: '#ffffff',
  border: activeTab === 'music' 
    ? '2px solid #ff6b6b' 
    : '1px solid rgba(220, 38, 38, 0.3)',
  padding: '0.75rem 1.5rem',
  borderRadius: '12px',
  cursor: 'pointer',
  transition: 'all 0.3s ease'
};`
    },
    interactions: {
      title: 'User Interactions',
      description: 'Handling user interactions and state management',
      code: `// Interactive Features
const handleArtistSelect = (artist) => {
  setSelectedArtist(artist);
  setUserRating(0);
};

const handleRating = (rating) => {
  setUserRating(rating);
  // Could save to backend here
};

// Modal with artist details
{selectedArtist && (
  <div style={{
    position: 'fixed',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    background: 'rgba(0,0,0,0.8)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  }}>
    {/* Modal content */}
  </div>
)}`
    }
  };

  return (
    <QElementComponent 
      elementId="code-showcase"
      style={{ 
        minHeight: '100vh', 
        background: 'linear-gradient(135deg, #1a1a1a 0%, #2d1b1b 50%, #1a1a1a 100%)',
        padding: '2rem',
        color: '#ffffff'
      }}
    >
      {/* Header */}
      <div style={{
        background: 'rgba(255,255,255,0.05)',
        borderRadius: '16px',
        padding: '2rem',
        marginBottom: '2rem',
        border: '1px solid rgba(220, 38, 38, 0.2)',
        backdropFilter: 'blur(10px)',
        boxShadow: '0 8px 32px rgba(0,0,0,0.3)'
      }}>
        <h2 style={{ 
          fontSize: '2rem', 
          fontWeight: '700', 
          margin: '0 0 1rem 0',
          background: 'linear-gradient(45deg, #ff6b6b, #dc2626)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent',
          backgroundClip: 'text'
        }}>
          üíª Code Showcase
        </h2>
        <p style={{ 
          color: '#cccccc', 
          fontSize: '1.1rem', 
          margin: '0 0 2rem 0',
          lineHeight: '1.6'
        }}>
          Explore the code behind this music platform interface
        </p>

        {/* Section Navigation */}
        <div style={{ display: 'flex', gap: '1rem', flexWrap: 'wrap' }}>
          {Object.keys(codeSections).map((section) => (
            <button
              key={section}
              onClick={() => setActiveSection(section)}
              style={{
                background: activeSection === section 
                  ? 'linear-gradient(135deg, #dc2626, #ff6b6b)' 
                  : 'rgba(255,255,255,0.1)',
                color: '#ffffff',
                border: 'none',
                padding: '0.75rem 1.5rem',
                borderRadius: '12px',
                cursor: 'pointer',
                fontSize: '1rem',
                fontWeight: '600',
                transition: 'all 0.3s ease',
                textTransform: 'capitalize'
              }}
            >
              {section}
            </button>
          ))}
        </div>
      </div>

      {/* Code Content */}
      <div style={{
        background: 'rgba(255,255,255,0.05)',
        borderRadius: '16px',
        padding: '2rem',
        border: '1px solid rgba(220, 38, 38, 0.2)',
        backdropFilter: 'blur(10px)',
        boxShadow: '0 8px 32px rgba(0,0,0,0.3)'
      }}>
        <h3 style={{ 
          fontSize: '1.5rem', 
          marginBottom: '1rem',
          color: '#ff6b6b'
        }}>
          {codeSections[activeSection].title}
        </h3>

        <p style={{ 
          color: '#cccccc', 
          marginBottom: '2rem',
          lineHeight: '1.6'
        }}>
          {codeSections[activeSection].description}
        </p>

        {/* Code Block */}
        <div style={{
          background: '#0a0a0a',
          borderRadius: '12px',
          padding: '1.5rem',
          border: '1px solid rgba(220, 38, 38, 0.3)',
          overflow: 'auto',
          fontFamily: 'Monaco, Consolas, "Courier New", monospace',
          fontSize: '0.9rem',
          lineHeight: '1.5'
        }}>
          <pre style={{ 
            margin: 0, 
            color: '#ffffff',
            whiteSpace: 'pre-wrap',
            wordBreak: 'break-word'
          }}>
            {codeSections[activeSection].code}
          </pre>
        </div>

        {/* Features List */}
        <div style={{ marginTop: '2rem' }}>
          <h4 style={{ 
            color: '#ff6b6b', 
            marginBottom: '1rem',
            fontSize: '1.1rem'
          }}>
            Key Features:
          </h4>
          <ul style={{ 
            color: '#cccccc', 
            paddingLeft: '1.5rem',
            lineHeight: '1.6'
          }}>
            <li>üé® Modern gradient backgrounds and glassmorphism effects</li>
            <li>üì± Responsive grid layouts that adapt to screen size</li>
            <li>‚ö° Smooth transitions and hover animations</li>
            <li>üéµ Interactive artist cards with modal details</li>
            <li>‚≠ê Rating system with visual feedback</li>
            <li>üîÑ State management for tab navigation and selections</li>
          </ul>
        </div>
      </div>
    </QElementComponent>
  );
};

export default CodeShowcase;
